// PlayerProfile.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';

function PlayerProfile({ summonerName }) {
  const [playerData, setPlayerData] = useState(null);

  useEffect(() => {
    fetchPlayerData();
  }, [summonerName]);

  const fetchPlayerData = async () => {
    try {
      const response = await axios.get(`https://your-backend-url.com/api/players/${summonerName}`);
      setPlayerData(response.data);
    } catch (error) {
      console.error('Error fetching player data:', error);
    }
  };

  if (!playerData) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>{playerData.summoner_name}#{playerData.tagline}</h1>
      <p>Total Score: {playerData.total_score}</p>
      <p>Average Score: {playerData.average_score}</p>
      <h2>Latest 20 Matches</h2>
      <ul>
        {playerData.matches.map((match) => (
          <li key={match.match_id}>
            <p>Match ID: {match.match_id}</p>
            <p>Score: {match.score}</p>
            <p>Kills: {match.kills}, Deaths: {match.deaths}, Assists: {match.assists}, CS: {match.cs}</p>
            <p>Date: {new Date(match.timestamp).toLocaleString()}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default PlayerProfile;
